import React, { useState } from 'react';
import { useParams } from 'react-router-dom';
import {
  Box,
  Typography,
  Button,
  Grid,
  Tabs,
  Tab,
  Paper,
  Breadcrumbs,
  Link
} from '@mui/material';
import productos from '../../data/productos.json';

export default function Detalle() {
  const { id } = useParams();
  const [tabIndex, setTabIndex] = useState(0);

  const producto = productos.find((p) => String(p.id) === id);

  if (!producto) {
    return (
      <Box sx={{ mt: 8, px: 4 }}>
        <Typography variant="h6" color="error">
          Producto no encontrado
        </Typography>
      </Box>
    );
  }

  return (
    <Box sx={{ mt: 6, px: 4, maxWidth: '1100px', mx: 'auto' }}>
      {/* Breadcrumbs */}
      <Breadcrumbs separator=">>" sx={{ mb: 3 }}>
        <Link href="/" color="#2e7d32">
          INICIO
        </Link>
        <Link href={`/productos/${producto.categoria.toLowerCase()}`} color="#2e7d32">
          {producto.categoria.toUpperCase()}
        </Link>
        <Typography color="#4caf50">{producto.nombre.toUpperCase()}</Typography>
      </Breadcrumbs>

      <Grid container spacing={4}>
        {/* Imagen */}
        <Grid item xs={12} md={5}>
          <Paper elevation={0}>
            <img
              src={producto.imagen}
              alt={producto.nombre}
              style={{
                width: '100%',
                borderRadius: 8,
                boxShadow: '0 4px 20px rgba(0,0,0,0.1)'
              }}
            />
          </Paper>
        </Grid>

        {/* Info básica + botones */}
        <Grid item xs={12} md={7}>
          <Typography variant="h4" sx={{ fontWeight: 'bold', color: '#43a047' }}>
            {producto.nombre.toUpperCase()}
          </Typography>

          <Typography variant="subtitle1" sx={{ fontWeight: 'bold', mt: 1 }}>
            {producto.tipo.toUpperCase()}
          </Typography>

          <Box sx={{ mt: 3 }}>
            {producto.botones?.map((btn, i) => (
              <Button
                key={i}
                variant="contained"
                href={btn.url}
                target="_blank"
                sx={{
                  bgcolor: '#f7931e',
                  color: '#fff',
                  fontWeight: 'bold',
                  borderRadius: 10,
                  px: 3,
                  py: 1,
                  mr: 2,
                  mt: 1,
                  boxShadow: '0px 3px 10px rgba(0,0,0,0.2)',
                  '&:hover': {
                    bgcolor: '#e07c00'
                  }
                }}
              >
                {btn.label.toUpperCase()}
              </Button>
            ))}
          </Box>
        </Grid>
      </Grid>

      {/* Tabs estilo Terco Emulsificante */}
      <Box sx={{ mt: 6, borderTop: '6px solid #4caf50', pt: 2 }}>
        <Tabs
          value={tabIndex}
          onChange={(_, newVal) => setTabIndex(newVal)}
          textColor="inherit"
          indicatorColor="primary"
          centered
          TabIndicatorProps={{
            style: { backgroundColor: '#4caf50', height: '4px' }
          }}
          sx={{
            '& .MuiTab-root': {
              fontWeight: 'bold',
              color: '#4caf50',
              mx: 2
            },
            '& .Mui-selected': {
              color: '#1b5e20'
            }
          }}
        >
          <Tab label="DESCRIPCIÓN" />
          <Tab label="TIPO" />
          <Tab label="SUBTIPO" />
          <Tab label="PRESENTACIONES" />
          <Tab label="MODO DE USO" />
        </Tabs>

        <Box sx={{ mt: 3, px: 3 }}>
          {tabIndex === 0 && (
            <Typography variant="body1" sx={{ lineHeight: 1.8, textAlign: 'center' }}>
              {producto.descripcion}
            </Typography>
          )}
          {tabIndex === 1 && (
            <Typography variant="body1" sx={{ textAlign: 'center' }}>
              {producto.tipo}
            </Typography>
          )}
          {tabIndex === 2 && (
            <Typography variant="body1" sx={{ textAlign: 'center' }}>
              {producto.subtipo || 'No especificado'}
            </Typography>
          )}
          {tabIndex === 3 && (
            <Typography variant="body1" sx={{ textAlign: 'center' }}>
              {producto.presentaciones}
            </Typography>
          )}
          {tabIndex === 4 && (
            <Typography variant="body1" sx={{ textAlign: 'center' }}>
              {producto.modoDeUso}
            </Typography>
          )}
        </Box>
      </Box>
    </Box>
  );
}
